import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import { green } from '@material-ui/core/colors';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import CheckBoxOutlineBlankIcon from '@material-ui/icons/CheckBoxOutlineBlank';
import CheckBoxIcon from '@material-ui/icons/CheckBox';
import Favorite from '@material-ui/icons/Favorite';
import FavoriteBorder from '@material-ui/icons/FavoriteBorder';
import RadioGroup from "@material-ui/core/RadioGroup/RadioGroup";
import Radio from "@material-ui/core/Radio/Radio";
import FormControl from "@material-ui/core/FormControl/FormControl";
import Button from "@material-ui/core/Button/Button";

const GreenCheckbox = withStyles({
    root: {
        color: green[400],
        '&$checked': {
            color: green[600],
        },
    },
    checked: {},
})((props) => <Checkbox color="default" {...props} />);



const AdminApplication = () => {
    const [state, setState] = React.useState({
        // checkedA: true,
        // checkedB: true,
        // checkedF: true,
        // checkedG: true,
        applicantgender: '',
        applicantpet: '',
        applicantsmoke: '',
        applicantdrink: '',
        neat: '',
        quite: '',
        roommategender: '',
        roommatedrink: '',
        roommatepet: '',
    });


    // const handleChange = (event) => {
    //     console.log(event.target.name);
    //     console.log(event.target.value);
    //     setState({ ...state, [event.target.name]: event.target.checked });
    // };

    const handleChange = (event) => {
        setState({ ...state, [event.target.name]: event.target.value });
    };

    return (
        <FormGroup>
            <h3>Applicant's info</h3>
            <div>
                <p>Applicant's gender</p>
                <RadioGroup aria-label="filters" name="applicantgender" value={state.applicantgender} onChange={handleChange}>
                    <FormControlLabel value="Male" control={<Radio />} label="Male" />
                    <FormControlLabel value="Female" control={<Radio />} label="Female" />
                    <FormControlLabel value="He/She doesn't mind" control={<Radio />} label="He/She doesn't mind" />
                </RadioGroup>

                <p>Does he/she have a pet?</p>
                <RadioGroup aria-label="filters2" name="applicantpet" value={state.applicantpet} onChange={handleChange}>
                    <FormControlLabel value="Yes" control={<Radio />} label="Yes" />
                    <FormControlLabel value="No" control={<Radio />} label="No" />
                </RadioGroup>

                <p>Does he/she drink?</p>
                <RadioGroup aria-label="filters3" name="applicantdrink" value={state.applicantdrink} onChange={handleChange}>
                    <FormControlLabel value="Yes" control={<Radio />} label="Yes" />
                    <FormControlLabel value="No" control={<Radio />} label="No" />
                </RadioGroup>

                <p>Neat</p>
                <RadioGroup aria-label="filters8" name="neat" value={state.neat} onChange={handleChange}>
                    <FormControlLabel value="Very neat" control={<Radio />} label="Very neat" />
                    <FormControlLabel value="Average neat" control={<Radio />} label="Average neat" />
                    <FormControlLabel value="Messy" control={<Radio />} label="Messy" />
                </RadioGroup>

                <p>Quite</p>
                <RadioGroup aria-label="filters9" name="quite" value={state.quite} onChange={handleChange}>
                    <FormControlLabel value="Very quite" control={<Radio />} label="Very quite" />
                    <FormControlLabel value="Average quite" control={<Radio />} label="Average quite" />
                    <FormControlLabel value="Noisy" control={<Radio />} label="Noisy" />
                </RadioGroup>

                <p>Does he/she smoke?</p>
                <RadioGroup aria-label="filters5" name="applicantsmoke" value={state.applicantsmoke} onChange={handleChange}>
                    <FormControlLabel value="Yes" control={<Radio />} label="Yes" />
                    <FormControlLabel value="No" control={<Radio />} label="No" />
                </RadioGroup>

            </div>
            {/*<FormControlLabel*/}
                {/*control={<Checkbox checked={state.checkedA} onChange={handleChange} name="checkedA" />}*/}
                {/*label="Secondary"*/}
            {/*/>*/}
            {/*<FormControlLabel*/}
                {/*control={*/}
                    {/*<Checkbox*/}
                        {/*checked={state.checkedB}*/}
                        {/*onChange={handleChange}*/}
                        {/*name="checkedB"*/}
                        {/*color="primary"*/}
                    {/*/>*/}
                {/*}*/}
                {/*label="Primary"*/}
            {/*/>*/}
            {/*<FormControlLabel control={<Checkbox name="checkedC" />} label="Uncontrolled" />*/}
            <h3>Applicant's expectation about roommates</h3>
            <div>
                <p>Gender preference</p>
                <RadioGroup aria-label="filters4" name="roommategender" value={state.roommategender} onChange={handleChange}>
                    <FormControlLabel value="Male" control={<Radio />} label="Male" />
                    <FormControlLabel value="Female" control={<Radio />} label="Female" />
                    <FormControlLabel value="He/She doesn't mind" control={<Radio />} label="He/She doesn't mind" />
                </RadioGroup>


                <p>Mind his/her roommate drinking?</p>
                <RadioGroup aria-label="filters6" name="roommatedrink" value={state.roommatedrink} onChange={handleChange}>
                    <FormControlLabel value="Yes" control={<Radio />} label="Yes" />
                    <FormControlLabel value="No" control={<Radio />} label="No" />
                </RadioGroup>

                <p>Mind his/her roommate having a pet?</p>
                <RadioGroup aria-label="filters7" name="roommatepet" value={state.roommatepet} onChange={handleChange}>
                    <FormControlLabel value="Yes" control={<Radio />} label="Yes" />
                    <FormControlLabel value="No" control={<Radio />} label="No" />
                </RadioGroup>

            </div>

            <Button color = "primary">Get matching results</Button>
        </FormGroup>
    );
}

export default AdminApplication;
